import React, { Component } from "react";
import UserItems from "./UserItems";

class Users extends Component {
  render() {
    return (
      <div>
        {this.state.users.map(user => (
          <UserItems key={this.props.users.id} user={this.props.user} />
        ))}
      </div>
    );
  }
}

export default Users;
